-- ----------------------------
--  View structure for `v_combobox`
-- ----------------------------
DROP VIEW IF EXISTS `v_combobox`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `upms`.`v_combobox` AS select 'sys_dept' AS `label`,`upms`.`sys_dept`.`deptid` AS `id`,`upms`.`sys_dept`.`deptid` AS `key`,`upms`.`sys_dept`.`deptname` AS `value` from `upms`.`sys_dept` union all select 'sys_role' AS `label`,`upms`.`sys_role`.`ROLEID` AS `id`,`upms`.`sys_role`.`ROLEID` AS `key`,`upms`.`sys_role`.`ROLENAME` AS `value` from `upms`.`sys_role`;

-- ----------------------------
--  View structure for `v_sysdept`
-- ----------------------------
DROP VIEW IF EXISTS `v_sysdept`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `upms`.`v_sysdept` AS select `upms`.`sys_dept`.`deptid` AS `deptid`,`upms`.`sys_dept`.`deptname` AS `deptname`,`upms`.`sys_dept`.`parentid` AS `parentid`,`upms`.`sys_dept`.`areacode` AS `areacode`,(select `a`.`value` from `upms`.`sys_dict` `a` where ((`a`.`label` = 'SBPL') and (`a`.`key` = `upms`.`sys_dept`.`areacode`))) AS `areaname`,`upms`.`sys_dept`.`state` AS `state`,`upms`.`sys_dept`.`phone` AS `phone` from `upms`.`sys_dept`;

-- ----------------------------
--  View structure for `v_sysuser`
-- ----------------------------
DROP VIEW IF EXISTS `v_sysuser`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `upms`.`v_sysuser` AS select `upms`.`sys_user`.`DEPTID` AS `DEPTID`,(select `upms`.`sys_dept`.`deptname` from `upms`.`sys_dept` where (`upms`.`sys_dept`.`deptid` = `upms`.`sys_user`.`DEPTID`)) AS `deptname`,`upms`.`sys_user`.`USERID` AS `USERID`,`upms`.`sys_user`.`USERNAME` AS `USERNAME`,`upms`.`sys_user`.`USERPWD` AS `USERPWD`,`upms`.`sys_user`.`STATE` AS `STATE`,`upms`.`sys_user`.`ROLEID` AS `ROLEID`,(select `upms`.`sys_dept`.`areacode` from `upms`.`sys_dept` where (`upms`.`sys_dept`.`deptid` = `upms`.`sys_user`.`DEPTID`)) AS `areacode`,(select `upms`.`sys_role`.`ROLENAME` from `upms`.`sys_role` where (`upms`.`sys_role`.`ROLEID` = `upms`.`sys_user`.`ROLEID`)) AS `rolename`,`upms`.`sys_user`.`realname` AS `realname` from `upms`.`sys_user`;

SET FOREIGN_KEY_CHECKS = 1;
